import Footer from './components/Footer.js';
import Nav from './components/Nav.js';
import Routers from './components/Routers.js';


function App() {
  return (
    <Routers>
      <div className="App">
        <Nav></Nav>
        <Footer></Footer>
      </div>
    </Routers>
  );
}

export default App;
